import React from 'react';
import { Card } from 'antd';
import 'antd/dist/antd.css';


class FrontCard extends React.Component {
    render() {
        return (
            <Card style={{ width: 300 }}>
                <p>Card content</p>
                <p>Card content</p>
                <p>Card content</p>
            </Card>
        );
    }
}

export default FrontCard;
